import React from 'react';
import { PowerBIEmbed } from 'powerbi-client-react'; // Assure-toi d'importer le bon composant

const Dashboard = () => {
  return (
    <div>
      <h2>Mon Dashboard Power BI</h2>
      <PowerBIEmbed
        embedConfig={{
          type: 'report',
          id: 'f7a7df31-5087-43e4-aa18-2db86a75abde', // Ton reportId
          embedUrl: 'https://app.powerbi.com/groups/13721a56-4896-485e-b3c3-d9a70c3680fb/reports/f7a7df31-5087-43e4-aa18-2db86a75abde/8e9eb7efae15c66beeeb?experience=power-bi', // Ton URL complet
          accessToken: 'TON_ACCESS_TOKEN', // Ton access token (à récupérer via backend)
          tokenType: window.powerbi.models.TokenType.Embed,
          settings: {
            panes: {
              filters: { visible: false },
              pageNavigation: { visible: true }
            }
          }
        }}
        cssClassName="embed-container"
        getEmbeddedComponent={(embeddedReport) => {
          console.log('Report embedded successfully:', embeddedReport);
        }}
      />
    </div>
  );
}

export default Dashboard;
